  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood NWR
  outlines Refuge accomplishments from February through April of 1941. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, and
  wildfires. Resource management is outlined; topics include share cropping. The public
  relations section of the report describes recreational uses and Refuge visitors.
  Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
